import React from 'react';
import logo from './logo.svg';
import './App.css';


function TitleComponent() {
  return (
    <div className = "Header">
      <h1>My List Invoice</h1>
    </div>
  )
}

function ListComponent(){
  return(
    <div>
      <table>
        <thead>
          <th>Invoice Number</th>
          <th>Vendor Name</th>
          <th>Vendor Address</th>
          <th>Invoice Total</th>
          <th>Invoice Date</th>
          <th>Due Date</th>
        </thead>
      </table>
    </div>
  )
}
function App() {
  return (
    <div>
      <TitleComponent/>
    </div>
  );
}

export default App;
